import "./Card.css"
export default function Card(props)
{
    return(
        <div className="card">

            <div className="card-item card-company-image">
                <img src={props.content.company_logo} />
            </div>

            <div className="card-item card-main-content">
                <small>
                    {props.content.company}
                </small>
                <h6>
                    {props.content.position}
                </h6>
                <div class>
                    {props.content.posted_on}
                    {props.content.timing}
                    {props.content.location}
                </div>
            </div>

            <div className="card-item card-keywords">
                <ul>
                    {props.content.keywords}
                </ul>
            </div>

        </div>
    );
}
